    <div>2023年10月开始腰骶部疼痛，左边更重，牵涉臀部，大腿。久治不愈，严重时疼痛无法入睡。半年后颈部至腰整个后背发紧，难受，紧束感，严重时也无法入睡。逐渐扩展展至两肋，脚底疼痛。康复治疗无效，针灸推拿，运动，热敷可缓解片刻。久坐久站久卧，阴雨，降温加重，晨起腰骶部僵硬酸痛，运动（跑步）可立即缓解。普巴瑞林，塞莱昔布无效。仁济，瑞金诊断腰椎间盘突出症，筋膜炎，中医诊断筋骨病，腰弊病</div>
